pragma solidity >=0.4.21 < 0.7.0;
pragma experimental ABIEncoderV2;

contract AccessLogger {

    mapping(address => uint256) accessRequestCount;
    mapping(address => uint256) signRequestCount;

    struct RequestTime {
        uint256 miningTime; //the timestamp at which the block was mined
        uint256 requestTime; //the timestamp sent from client claiming request time
    }

    struct AccessRequest {
        // address  signerAddress; //address of the account requesting access to credentials
        string[] credentialIds; //credentials requesting access to
        string   SAD;           //SAD - response from credentials/authorize request
        // bool     granted;       //true if SAD is present - false otherwise
        RequestTime timestamp;
    }

    struct SignRequest {
        // address     signerAddress;  //address of the account requesting to sign
        string[]    toSign;         //hashes to sign
        string      SAD;            //SAD used to authorize signature - must match with Access Request SAD - cum?
        string[]    signatures;     //signed hashes - response from signatures/signHash
        RequestTime timestamp;
    }

    mapping(address => AccessRequest[]) accessRequests;
    mapping(address => SignRequest[])   signRequests;

    function registerAccessRequest(string[] memory _credentials, string memory _SAD, uint256  _timestamp) public {
        if(bytes(_SAD).length > 0 && _credentials.length > 0) {
            accessRequests[msg.sender].push(

                AccessRequest({
                    credentialIds: _credentials,
                    SAD: _SAD,
                    timestamp: RequestTime({
                        miningTime: now,
                        requestTime: _timestamp
                        })
                })

            );
            accessRequestCount[msg.sender]++;
        }
    }
    function registerSignRequest(string[] memory _toSign, string memory _SAD, string[] memory _signatures, uint256  _timestamp) public {
        if(bytes(_SAD).length > 0 && _toSign.length > 0) {
            signRequests[msg.sender].push(
                SignRequest({
                    toSign: _toSign,
                    SAD: _SAD,
                    signatures: _signatures,
                    timestamp: RequestTime({
                        miningTime: now,
                        requestTime: _timestamp
                        })
                })
            );
            signRequestCount[msg.sender]++;
        }
    }

    // function set(string memory _greeting) public {
    //     greeting = _greeting;
    // }

    // function get() public view returns (string memory){
    //     return greeting;
    // }
}
